import React from "react";
import UserCard from "./UserCard";

const ProductList = ({userList,removeUser}) => {
    return (
        <div>
            {
                userList.map((user,index) => { 
                    return (
                        <div>
                        <UserCard key={index} name={user.name} age={user.age} position={user.position} removeUser={removeUser}/>

                        </div>
                    )
                })
            }
            
        </div>
    )
}

export default ProductList;
